import '../css/App.css';
import Grafik from '../components/Grafik';
import Tablo from '../components/Tablo';
import MobileTab from '../components/MobileTab';
import Table from '../components/MobileTab';

import Navbar from '../components/Navbar';
import useFetch from '../hooks/useFetch';

function createTableMobil(data){
  return(
    <MobileTab
    name={data.name} 
    surname={data.surname}
    position={data.position}
    status={data.status}
    successful_piece={data.successful_piece}
    fire_piece={data.piece}
    />
  )
}

function createTable(data){
  return(
    <Tab
    name={data.name} 
    surname={data.surname}
    position={data.position}
    status={data.status}
    successful_piece={data.successful_piece}
    fire_piece={data.piece}
    />
  )
}

export default function Admin() {
  const {data,loading,error}=useFetch("/employee/getEmployee");

  return (
   <div>
     <div className=' flex '>
      <div className='admin-navbar'>
        <Navbar />
      </div>
      <div className= ' w-full'>
      <div className=' admin-menu'>
      <div className='  w-16'>
       <a href='/deneme'> <img src='img/menu2.png' alt='menu' className='p-3' /></a>
      </div>
      <div className='flex w-full '>    
       <div className=' admin-menu-text '><a href='deneme'>Anasayfa</a></div>
      <div className=' admin-menu-text '><a href='deneme'>Adminler</a></div>
      <div className=' admin-menu-text '><a href='deneme'>Sipari≈üler</a></div>
      </div>
      <div className='w-16'>
      <a href='/deneme'> <img src='img/menu.png' alt='menu' className='p-3' /> </a>
      </div>
      </div>

        <Grafik />
        {data.map(createTable)}
        {data.map(createTableMobil)}
      </div>

    </div>
   </div>

  );
}
